import React from "react";


class App extends React.Component{

    constructor() {
        super();

        this.state={
            heroes:[
                    {name:'Spider-man',
                    id:'1'},
        {name:'BatMan',id:'2'},

        {name:'SuperMan',id:'3'},

        {name:'Hulk',id:'4'},
    ]
        };
    }

    render() {
        return (
        <div>
            {this.state.heroes.map(hero=><h1> key={hero.id} {hero.name} </h1> )}
        </div>
        )
    }
}
export default App;
